 serializer.is\_valid(raise\_exception=True)
 user = serializer.save()
 # Create refresh token for user using simplejwt
 refresh = RefreshToken.for\_user(user)
 res = {
 "refresh": str(refresh),
 "access": str(refresh.access\_token),
 }

 return Response({
